/match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1742655966896_58E01F85-F0DE-4095-BDB9-4225FC1576D2.jpg',1,'졌지만 너무 재미있었다 !!!!\n증수빈 민석 재환 채고채고\n콜어빈 좀 ㅠㅠ 힁 갠차나 ㅕ\n영하야.. 갠차나!! 시즌 이제 시작이야 기죽지말자\n치국이 정수 너무 나이스해따\n명진아 기죽지마 !!!!!! 할수있다 멘탈잡자 화이팅하쟈아','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/ticket/1742655968003_706E7A3E-AF32-4EE0-8B21-A48A3E8E5B46.jpeg'),(31,'F3D9AE87-5D10-480F-92F1-834FB3B28711',10,'2025-03-23','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1742687571064_84C7C119-5319-42B4-9B11-A0AE9472EDD9.jpg',7,'1회초 부터 삼성이 3:0으로 이겨서 진짜 질 줄 알았는데… 머선129 기아 ㄹㅇ 개잘함 그래서 압도 해버림❤️','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/ticket/1742687571711_6CA0FD34-6FB3-49CD-9B13-417189EEFDE5.jpg'),(32,'86F28002-BC0A-4FEA-BDE0-BF4821B53E9B',9,'2025-03-23','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1742688183510_927CA239-A9B7-4DB9-BFF9-4D47F7F97339.jpg',3,'개막전 4:3 승리~','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/ticket/1742688183777_EDD5AA5F-DD6A-4D49-9EBA-33AF8EE53B9A.png'),(34,'293F7B0A-C155-4001-8342-9DB5AD881F32',5,'2025-03-22','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1742693169283_EEF8E938-75E3-4138-BB70-3C8A1D1FA927.jpg',7,'개막전',NULL),(35,'41718E7D-A1FE-4C80-874B-494031C4A503',4,'2025-03-22','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1742695046903_F047A2BF-74EB-49C1-824C-985D1FE63A4C.jpg',3,'⚾️ kt 위즈파크에서 첫 개막 한화 승리⚾️\n\n👏👏👏👏👏👏👏👏👏👏👏👏👏\n\n☺️물회, 반반 새우 너무 맛있엉☺️',NULL),(38,'DC12A761-DEAF-4F7A-B7F0-B46E994E7D44',8,'2025-03-23','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1742696461912_B7C51CE5-BA0C-43EB-B1B8-902BF5D56315.png',5,'시민구장에서 마지막으로들었던 달빛자욱이 부활했다.\n동생이 티켓구해준것도 너무 좋았다. 아빠가 대구사람이여서 너무 좋다. 나는 부태삼팬💙💙💙💙',NULL),(39,'EF8879BA-2A9C-41CB-A847-81D3BFF9B9FF',9,'2025-03-23','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1742699570513