.\n아니나 다를까 첫 공격부터 상대 볼넷으로 운좋게 얻은 찬스를 날려먹은 데다가 믿고있던 류현진마저 홈런을 뚜드러 맞으며 끌려가던 경기\n갑자기 채그레디 대타로 나온 문현빈이 홈런을 갈기더니 이진영이 이어서 추격포를 쏘아올림\n9회 2사 대현빈\n',NULL),(428,'5080817F-CA9B-4DE7-A97F-4601E13705B1',71,'2025-04-08','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744618600545_8FC65A6A-17FD-4C18-BB57-9DE7B60F53C1.jpg',2,'대구에서 레전드 경기를 보고와서인지 질 것대구에서 레전드 경기를 보고와서인지 질 것 같지 않았다\n시작부터 노시환 쓰리런이 나오면서 예감이 맞는 듯했다\n하지만 동주의 안타까운 투구가 이어지고 홈런도 맞다가 플로리얼의 지리는 에러로 어이없이 역전\n꾸역꾸역 어거지로 다시 뒤집으면서 이기나 했는데 또 한승혁이 올라와서 불을 쳐지름 개새기 ㅗㅗ 다신 안나왔음 좋겠네',NULL),(429,'5080817F-CA9B-4DE7-A97F-4601E13705B1',81,'2025-04-10','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744618783500_4AFAAEDB-9C7C-4626-AA3F-268E56982D9B.jpg',2,'이번엔 동욱이 준서 성엽이랑 도전이다\n의외로 팽팽한 투수전 양상이었는데 6회에 대경문의 도루쇼 작렬\n정신못차리는 양의지와 더불어 기대가 1도 안되던 브랜드신의 적시타까지 뭘본건지 아직도 믿기질 않음\nㅋㅋㅋㅋ 동욱이의 안타까운 표정까지 참 재밌는 경기였다\n와이스 완봉인줄 알았는데 까비',NULL),(430,'F44106E2-D02C-4AB0-B8C5-681ACC961FA7',97,'2025-04-13','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744621702379_AEB26B79-59B0-4BAE-B1F4-CDD550934163.jpg',2,'🆚 두산 (패) 2:9\n⚾️ 비오고 눈오고 우박내리고 난리나는 바람에 주영이 컨디션 완전 안좋았음. 1회부터 착실이 말아먹고 2:9로 짐\n⚾️ 중간에 저쪽 투수 흔들릴때 민재가 도루자 하는바람에 1사 만루 될 수 있었던게 2사 만루됨. 민재 이놈시키.\n⚾️ 너무 추워서 주전 빼고 백업 많이 쓴건 잘함.\n⚾️ 담게임에 힘내자 주영이.',NULL),(431,'5034E5DD-BB90-44B8-B54B-BB38948AF2AA',28,'2025-03-28','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744627094494_43E4AACA-9D0C-4C73-A11B-58F871B16E40.jpg',6,'롯데자이언츠vskt위즈\n선발투수 반즈\n',NULL),(432,'5034E5DD-BB90-44B8-B54B-BB38948AF2AA',58,'2025-04-04','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744627179831_FC2A0112-B958-4861-870C-AE294CB6CDA6.jpg',6,'롯데자이언츠vs두산베어스\n선발투수 반즈\n','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744627330563_397D33BD-B8D5-4FD0-B206-25A9476DDF2E.jpg'),(433,'5034E5DD-BB90-44B8-B54B-BB38948AF2AA',88,'2025-04-11','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws