FB-FC9B-4807-8793-1E37B13FA940.jpg',9,'수민이랑 두번째 고척! \n다크버건디 시야 도랏음 ㅠㅠㅠ 선수들 잘 보이고 응원단상이랑 가까워서 좋앗다\n중계 또 잡힘ㅋㅋ ㄹㅇ열심히 응원하면 잡아주나벼;;\n근데 13:1 ㅋ 역시 꼴찌 키움','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744719166325_B9790E0A-8BEF-4579-A4DF-A02B02190023.jpg'),(454,'F47D86A2-38F7-46A7-94F8-5051663BE9AE',102,'2025-04-15','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744722188684_41714E11-01B9-4285-BFF2-B12B211EDAF8.jpg',1,'미쳤니진짜 안타 2개 실책 4개ㅋㅋ 좋게 말 하려해도 할 수가 없네 타자들아.. 못 치는 것도 정도가 있는거야.. 언제까지 못 칠래? 진짜.. ㅠㅠ 그럼 수비라도 잘 하던가 둘 다 못해ㅡㅡ 투수들만 고생하고.. 하….. 투수들 고생했고 타자들아 내일은 제발 좀 쳐라 선발들 승투 좀 하..ㅠㅠㅠㅠㅠㅠ 진짜 개빡쳐 죽겟어ㅠㅠㅠㅠ 안봣어; 보다 걍 껐어',NULL),(455,'A1F51FF0-78F8-4B0D-9C83-8CF1A830D467',3,'2025-03-22','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744726117184_ì¤ëì_ì§ê´ì¼ê¸°_2025-04-15T14-07-34.357Z.jpg',5,'개막전에 첫 테이블 석 이였는데 타격 폭발로 승리해서 너무 좋았다!\n',NULL),(456,'1A3B4625-AB16-4092-90D2-E4B134B0FF44',101,'2025-04-15','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744729114555_EFA2DDF0-004E-4DF1-B94C-72EFC24C38B4.jpg',2,'오느른 잠실에 엘지트윈스와 경기하는걸 보러갔다. 노히트노런경기를 보게될줄은 몰랐다… 우리가 노히트노런인… 그치만 재밌었다 하지만 삼성 타자들은 좀 반성하자.',NULL),(457,'1A3B4625-AB16-4092-90D2-E4B134B0FF44',89,'2025-04-11','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744729250282_5898E40E-21C1-4BFA-AFCA-ACE50CE78AEF.jpg',3,'오느른 케이티원정을 갔다. 왜이렇게 못하는지 화가났다. 그치만 나름 반격도 하려해서 재밌게 본 것 같다. 지우가 케이티팬이 된건 아쉽지만 그래듀 난 삼성을 응원해야지💙🦁',NULL),(458,'1A3B4625-AB16-4092-90D2-E4B134B0FF44',37,'2025-03-30','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744729368140_A389D8FA-E4E4-41F5-A213-65FB4632E3DF.jpg',2,'오늘은 두산대삼성 원정을 갔다! 쫄깃쫄깃햇지만 결국 삼성이 이교따 !! 첫 삼성직관이 이겨서 참 행복했다 그치만 불펜은 아직 무섭다 애두라 그래도 이겨줘서 고마우야',NULL),(459,'F44106E2-D02C-4AB0-B8C5-681ACC961FA7',101,'2025-04-15','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744729991514_7D07752C-3C5B-4BFC-A177-A6EE425832D6.jpg',2,'🆚 삼성