ttps://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744878502792_9D558DA9-4C27-4569-93C8-F74E3251BDB4.jpg',2,'야구 보기 좋다 앞으로도 계속 되길..⭐️',NULL),(550,'9669E806-2B97-435F-943A-F3836E006F25',NULL,'2024-09-14','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744885839606_empty.jpg',1,'8번째 직관!\n니퍼트 은퇴식ㅠㅠㅠㅠ\n오늘은 살면서 처음으로 블루석에 앉았는데 진짜 가까웠고 니퍼트 은퇴식을 직접 볼 수 있어서 너무 좋았다.또 처음 퇴근길을 기다려봤는데 이병헌과 김택연을 봤다.둘 다 너무너무 잘생기고 특히 김택연은 너무 귀여웠다.폰케이스에 싸인을 받아서 너무 좋았다.\n\n3루 블루석 218블럭 11열 151번',NULL),(551,'9669E806-2B97-435F-943A-F3836E006F25',NULL,'2024-05-31','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744885839749_empty.jpg',1,'1번째 직관!\n우리 팀 두산!\n두산에게 반했던 나의 첫 야구장\n\n중앙 네이비석 318블럭 7열 80번',NULL),(552,'9669E806-2B97-435F-943A-F3836E006F25',NULL,'2024-08-07','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744885839818_empty.jpg',1,'4번째 직관!\n직관 첫 우승!!\n직관 첫 우승이라 너무 기뻤지만 중앙은 많이 고요하다..\n1루 뒤에 서서 응원했더니 다리가 매우 아팠고 응원을 너무 열심히 했는지 어깨가 매우 아프다 그치만 아주 즐거웠다!!\n\n중앙 네이비석 320블럭 12열 131번',NULL),(553,'9669E806-2B97-435F-943A-F3836E006F25',NULL,'2024-09-24','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744885839890_empty.jpg',1,'11번째 직관!\n포스트시즌 진출 확정!!!\n홈에서하는 마지막 경기인 만큼 진짜 설렜는데 이겨서 너무 좋았고 또 선수들의 인사는 진짜 감동이었다. 나는 앞으로 평생 두산을 좋아해야겠다. 포스트시즌 진출 확정을 정말정말 축하하며 우리 두산 가을에 야구 오래오래 했으면 좋겠고 우리 선수들 항상 다치지 않았으면 좋겠다.\n\n1루 외야지정석 406블럭 8열 103번',NULL),(554,'9669E806-2B97-435F-943A-F3836E006F25',NULL,'2024-10-03','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744885839964_empty.jpg',1,'포스트시즌 1번째 직관!\n두산 부끄럽습니다..\n\n솔직히 와일드 카드에서 이렇개 무너졌다는게 참 믿기지도 않고 화도 많이 났다.처음으로 두산 유니폼을 입은게 창피했고 많은 실망감도 느꼈다.하지만 비록 와일드카드에서 무너졌어도 내년에는 꿋꿋이 일어나기를 바라며 오늘도 내일도 언제까지나 최강두산',NULL),(555,'9669E806-2B97-435F-943A-F3836E006F25',NULL,'2024-08-15','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744885840035_empty.jpg',1,'6번째 직관!\n김택연 조수행 사랑해\n내 본진이 둘 다 나왔던 이번 경기! 일찍가서 슈몽이도 겟!심지어 승리까지!! 오늘은 가서 맛있는것도 잔뜩 먹었고 조수행 김택연도 봤던 너무너무 좋았던 날!김택연은 사랑이다♥ 완전 박빙이었던 오늘 경기 승리로 끝나 너무 행복했다!\n\n1루 네이비석 307블럭 4열 48번',NULL),(556,'9669E806-2B97-435F-943A-F3836E006F25',NULL,'2024-07-19','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744885840102_empty.jpg',1,'2번째 직관!\n응원법 열심히 외우기!\n두산이 더 더 좋아졌다.\n\n3루 네이비석 326블럭 12열 131번',NULL),(557,'9669E806-2B97-435F-943A-F3836E006F25',NULL,'2024-07-25','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744885840178_empty.jpg',1,'3번째 직관!\n비와서 더 즐거웠다!\n윈터가 시구를 왔는데 너무 예뻤고 비가 왔지만 너무 신나고 재밌게 응원했었다.\n\n1루 네이비석 305블럭 2열 14번',NULL),(558,'9669E806-2B97-435F-943A-F3836E006F25',NULL,'2024-08-25','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744885840266_empty.jpg',1,'7번째 직관!\n진짜 너무 화난다\n진짜 그냥 우리 팀이 너무 못해서 할 말이 없다..너무 스트레스 받고 렛두로 보러 왔는데 너무너무너무너무 못했다..야구 접을까\n\n1루 네이비석 306블럭 10열 97번',NULL),(559,'9669E806-2B97-435F-943A-F3836E006F25',NULL,'2024-09-23','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744885840358_empty.jpg',1,'10번째 직관!\n직관 3연승까지!!\n오늘은 오랜만에 1루 내야에 갔는데 진짜 응원하기에 너무 좋았다.굥기가 완전 따라잡고 따라잡히고 하는 경기여서 너무 재미있었고 김택연의 마무리는 역시 아무도 따라올 사람이 없다.\n\n1루 네이비석 304블럭 10열 138번',NULL),(560,'9669E806-2B97-435F-943A-F3836E006F25',NULL,'2024-09-19','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744885840446_empty.jpg',1,'9번째 직관!\n망곰데이+승요\n살면서 처음으로 외야에 가봤는데 생각보다 나쁘지 않았다!그치만 분명히 1루인데 기아 팬이 너무 많았고 다 기아를 응원해서 그닥 기분이 좋지는 않았는데 그래도 오늘 이겨서 정말 좋았다!\n\n1루 외야지정석_시야방해 402블럭 13열 194번',NULL),(561,'9669E806-2B97-435F-943A-F3836E006F25',NULL,'2024-08-14','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744885840541_empty.jpg',1,'5번째 직관!\n홈 유니폼 겟!\n드디어 홈 유니폼을 사고 김택연을 마킹했는데 마킹 상태가 불안하다.. 왜 우리는 또 지고 있는가….\n\n1루 네이비석 310블럭 15열 190번',NULL),(562,'F44106E2-D02C-4AB0-B8C5-681ACC961FA7',111,'2025-04-17','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744895218760_F5220200-158E-43E6-A085-DA47FB57DABA.jpg',2,'🆚 삼성 3:6(패)\n⚾️ 승기가 초반에 털려서 5이닝 못 채우고 내려감. 펜스 바로 앞에서 잡히는 타구가 너무 많아서 뭘 해도 안 되는 날이었음.\n⚾️ 그래도 선취점 해민이가 해주고 9회말 원영, 본혁이 차례대로 안타치고 나가서 점수내서 좋았음',NULL),(563,'F47D86A2-38F7-46A7-94F8-5051663BE9AE',107,'2025-04-16','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744896545769_7072394A-A3C0-4BF6-BE63-7126177A108C.jpg',1,'미쳤구나정말로빡침을넘어선감정이야이건. 진짜.. 타자들아 농군 입고 분위기 바꾸려는 거 알겠어; 근데 결과가 나와야 뭘 우리도 반응을 하지 지금 그냥 개막부터 지금까지 타격이 이 꼬라지면 우리가 뭘 어떻게 해야할까.. 3위야.. 우리가 아직도 3위인데 우리가 원하는 건 3위가 아니라 1위라는 걸 제발 좀 알면 좋겠어 최정 에레디아 보고싶어요',NULL),(564,'F47D86A2-38F7-46A7-94F8-5051663BE9AE',112,'2025-04-17','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744896756857_FAF2B4E0-33C2-4B90-BCED-F0A29BAD99B8.jpg',1,'5위 축하해 미치겠다 진짜!! 하… 빡쳐서 돌아버리겠음 야구 보기가 싫음 걍 보면 바로 쓰고싶음; 나도 진짜 욕하기 싫은데 니네가 욕 나오게 하잖아 칭찬 할 것:화이트 좋다…ㅋ🤍 최지훈 3안타도 좋아 좋은데.. 하 득점권만 되면 어떻게 아무것도 안치니 1회에 2점 내면 끝이니? 팬들이 더 힘들어 진짜 경기 보기가 힘들다고. 이제 엘지라고..ㅠ제발 이기자',NULL),(565,'F0225D86-2FD6-4DE8-B182-C6C3ADE2EFB7',3,'2025-03-22','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744897377399_48BEE657-7564-43DF-9981-CA8B1CCC449F.jpg',5,'개막전 대승 💙','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/ticket/1744897377740_96ADDC60-9B91-40C8-BCF4-1B2A6828EE5B.jpg'),(566,'F0225D86-2FD6-4DE8-B182-C6C3ADE2EFB7',32,'2025-03-29','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744897547889_851E63C2-C301-43F6-872A-24466CD9ED44.jpg',2,'너무 추웠어요... 그치만 몰아치기 미쳤따 💙',NULL),(567,'F0225D86-2FD6-4DE8-B182-C6C3ADE2EFB7',37,'2025-03-30','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744897604626_36CE7543-7477-444C-94F5-1AC43F343A3A.jpg',2,'눈 맞으면서 야구를 볼 수도 있구나 .......\n마지막에 심장 쫄렸지만 그래도 또 이겼다 💙',NULL),(568,'F0225D86-2FD6-4DE8-B182-C6C3ADE2EFB7',27,'2025-03-28','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1744897663873_2C8DE502-3704-4F46-8A95-90133417FEE7.jpg',2,'후라도 완투패 ....\n빠따들아 대가리 박아 라도한테 사과해',NUL