naws.com/uploads/1746547414941_50966D21-5CA5-4917-A97D-B41A5F62E696.jpg',4,'주리랑 시즌 첫직관!\n엄청난 타율에 백투백 홈런까지🧡',NULL),(1039,'0AC15537-CB07-495F-B750-2A702938D89C',151,'2025-04-26','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1746547523117_5FECD71F-208F-4136-8B91-58C74B42206F.jpg',4,'경기 시간 지나고 암표로 갑작스럽게 가게 된 직관!\n응단 옆 구역자리여서 너무 재밌게 응원했당🤍',NULL),(1040,'A641ABAF-054C-4008-BDC5-C27440654949',NULL,'2024-09-27','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1746617058153_empty.jpg',1,'롯데vs 엔씨 6:13 승리\n밀리터리 유니폼\n3 루 상단 석\n엄마 오빠\n나의 직관 마지막 이겼다. 왜냐하면 엄마가 삼시세끼를 본다고 경기에 집중을 안 했기 때문에 이겼다. 마지막 직관이 이겨서 너무 기분이 좋았다.😊😊',NULL),(1041,'A641ABAF-054C-4008-BDC5-C27440654949',NULL,'2024-06-28','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1746617058514_empty.jpg',1,'롯데vs한화 6:4 승\n밀리터리 유니폼\n중앙 상단석\n삼촌 오빠 규림이 언니\n이때 규림이 언니랑 야구장을 갔었는데 규림이 언니가 내 바다 유니폼이 예쁘다고 샀다 그리고 윤동희도 좋아하게 됐다 그런데 나는 윤동희를 좋아 하는 사람이 또 생겨서 싫었다😡😡',NULL),(1042,'A641ABAF-054C-4008-BDC5-C27440654949',NULL,'2024-05-10','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1746617058683_empty.jpg',1,'롯데vs엘지 9:1로 패배\n로케트 배터리존 \n삼촌,할머니,엄마,오빠 \n동백 유니폼\n나의 첫 직관인데 졌다 이때 부터 윤동희에 빠졌다 다음애도 또가보고 싶다ㅏ❤️❤️',NULL),(1043,'A641ABAF-054C-4008-BDC5-C27440654949',NULL,'2024-06-09','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1746617058903_empty.jpg',1,'롯데vs랜더스 5:1 패 \n동백 유니폼\n1루 응원석\n삼촌 나연 엄마 오빠\n나연이랑 처음가는 야구장 이였다 근데 이때가 1,2차전 이 있었는데 2차전때는 카리나가 왔는데 그걸 못봐서 너무 아쉬웠고 경기도 져서 슬펐다😭😭\n',NULL),(1044,'A641ABAF-054C-4008-BDC5-C27440654949',NULL,'2024-08-24','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1746617059063_empty.jpg',1,'롯데vs삼성 11:3 승\n원정 유니폼\n원정 응원석\n삼촌 할머니 오빠 아빠 엄마\n처음으로 대구로 원정을 갔는데 역시 지은지 얼마안돼서 좋았다 그리고 이때 윤동희가 홈런을 쳤다 이때 김영웅이 생일이였다 너무 축하한다 영웅아🥳🥳',NULL),(1045,'A641ABAF-054C-4008-BDC5-C27440654949',NULL,'2024-07-13','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1746617059262_empty.jpg',1,'롯데vs 케이티 6:3패\n바다 유니폼\n외야석\n삼촌 할머니 엄마\n 이때 빨리가서 앉아 있었는데 연습하는 홈런공이 삼촌 쪽으로 날라와 삼촌이 잡았다 근데 그공을 오빠가 들고 있다 그래서 너무 화가난다😤😤',NULL),(1046,'A641ABAF-054C-4008-BDC5-C27440654949',NULL,'2025-03-09','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1746617059432_empty.jpg',1,'KIA vs 롯데 0:0무승부\n이때 시범경기에 갔다 근데 자리가 3루였다 윤동희가 첫타석에 부상을당해서 바로 교체당한게 많이 슬펐다\n',NULL),(1047,'A641ABAF-054C-4008-BDC5-C27440654949',NULL,'2024-09-18','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1746617059592_empty.jpg',1,'롯데 VS LG 5:3 패\n바다 유니폼\n1루 내야 상단석\n할머니 엄마 아빠 오빠\n윤동희 생일 기념으로 이때 야구를 보러 갔는데윤동시는 한건도 못 하고 끝나버렸다 그리고 삼촌 이 응원 단상 바로 앞을 잡아 줘서 기분이 좋았지만 옆에 치어리더를 찍으려고 대포 카메라를 들고 온 아저씨들이 많아서 좋지는 않았다😠',NULL),(1048,'A641ABAF-054C-4008-BDC5-C27440654949',NULL,'2024-08-28','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1746617059772_empty.jpg',1,'롯데vs한화 7:0 패\n홈 유니폼\n3루 내야석\n엄마 오빠\n응원 타월 받으로 황급히 예매 했더니 3루 였다 그래도 응원 타월이 예뻐서 다행이다😏',NULL),(1049,'A641ABAF-054C-4008-BDC5-C27440654949',NULL,'2024-09-07','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1746617059965_empty.jpg',1,'롯데 VS SSG 1:1 무승부\n홈 유니폼\n로케트 배터리 존\n삼촌 할머니 엄마 오빠\n있대 엄마가 야구 보기 전에 임영웅을 1번 안고 와 서 그런가 경기가 무승부로 끝났다. 그리고 오빠 랑 나는 7월 초에 나와가지고 싸인을 받을려고 서 있었는데 결국 손호영 밖에 못 받았다😓',NULL),(1050,'A641ABAF-054C-4008-BDC5-C27440654949',NULL,'2024-07-25','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1746617060162_empty.jpg',1,'롯데vs엘지 9:6 패\n유니세프 유니폼\n중앙 탁자석\n엄마 오빠 할머니\n이때 연장전 까지 갔었는데 져서 아쉬웠다 티비에 우리가 열심히 응원하는 장면이 나와서 좋았다😊',NULL),(1051,'A641ABAF-054C-4008-BDC5-C27440654949',NULL,'2024-08-17','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1746617060353_empty.jpg',1,'롯데vs키움 8:7 패\n홈 유니폼 \n3루 상단석\n삼촌 할머니 엄마 오빠\n이때 키움이랑 했는데 1점 차이로 졌다 그래도 꼴찌팀인데 지는게 너무 분했다😡',NULL),(1052,'A641ABAF-054C-4008-BDC5-C27440654949',NULL,'2024-06-01','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1746617060573_empty.jpg',1,'롯데vs엔씨 4:2 패 \n3루 내야석\n밀리터리 유니폼\n엄마 오빠\n 이때 처음으로 유니폼을 샀다 바다유니폼이였는데 너무 예뻤다 나의 첫유니폼인 만큼 소중히 아껴야 겠다❗️❗️',NULL),(1053,'A641ABAF-054C-4008-BDC5-C27440654949',NULL,'2024-11-03','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1746617060772_empty.jpg',1,'레드 페스티벌\n오늘 레드 페스티벌에 갔다근데 사람이 엄청 많았다\n사직 야구장에 들어가니까 되게 콘서트 느낌이었다선수들의 끼를 볼때 나는 젝키가 가장 좋았다 특히 파다맛 캰디(김민석) 미역맛 캔디(박준우)가 가장 좋았다',NULL),(1054,'A641ABAF-054C-4008-BDC5-C27440654949',NULL,'2024-09-06','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1746617060963_empty.jpg',1,'롯데vs삼성 7:2 패\n홈 유니폼\n1루 내야 상단석\n엄마 오빠\n이 경기가 삼성 하고 하는 마지막 날이 었어서 갔었다그런데 초반에는 이기고 있었는데 뒤에 역전을 당하니까 기분이 좋지 않았다😢\n',NULL),(1055,'BA87C219-08DE-41F1-9E65-7C59C22CA17D',189,'2025-05-04','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1746624829943_2667262B-CFE0-4B41-8667-B9DA93DC6DDB.jpg',3,'첫 위즈파크! \n또 짐',NULL),(1056,'BA87C219-08DE-41F1-9E65-7C59C22CA17D',200,'2025-05-06','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1746624858443_72DDFC3A-B4AC-4F40-B03D-DE9899263EBC.jpg',9,'고척 또 짐 \n개같다',NULL),(1058,'C5FEF51C-935E-4CE6-8070-17C0537A95FA',201,'2025-05-07','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1746626947944_D8E58F44-98EB-4471-AC76-9C7FB59C4E25.jpg',4,'승요',NULL),(1059,'6D2F256F-C90E-4D02-B90D-4E6CCF094981',202,'2025-05-07','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1746630381064_7DD259C0-2028-448E-B204-40A4881CC5E2.jpg',2,'ㅋㅋㅋㅋ당일에 외야 급하게 구해서 갔는데 재밌었누~!참내 깨진 머리 언제 봉합하냐~~~',NULL),(1060,'8E4E4536-7493-4541-BCA7-9A3B2B5DC48E',201,'2025-05-07','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1746632191874_C741FAD5-CBFC-44F9-92DD-59B20B3C26FF.jpg',4,'9연승, 단독 1위',NULL),(1061,'F850132D-8A7A-47BB-AC0B-9765F54E0AC5',196,'2025-05-06','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1746643180286_AB39D2C8-0939-40BC-93D2-8747BB98DCDF.jpg',4,'