,(1252,'983EAA4A-B81E-4696-AAD3-4A1D949C9738',241,'2025-05-17','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1747570971979_B0E4A5E2-BB73-445F-89A2-4B48B65CC7F0.jpg',4,'vs ssg 선발 와이스 ',NULL),(1254,'FF14E7AF-C99F-4CB8-9C0B-5CBC029C4284',NULL,'2024-09-08','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1747573184821_empty.jpg',1,'어젠 졌지만 괜찮습니다.\n왜냐구요? 오늘 선발이 원태인이기 때문이죠.\n그리고 처음 가본 블루존은 걍 뒤집어졌어요ㅋㅋ\n경기 보는건 외야가 정말 좋긴 한데.. 난 응원 하기 위해 야구장에 오는 사람 이기 때문에 블루존이 너무나도 내 취향이었음ㅋ큐ㅠ',NULL),(1255,'FF14E7AF-C99F-4CB8-9C0B-5CBC029C4284',NULL,'2024-09-01','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1747573184936_empty.jpg',1,'얼마 만에 온 야구장이야아~~\n게다가 원태인 선발이었어~\n9월 되자마자 칼같이 2시 경기 하는데 덕분에 진짜 죽을 뻔..ㅠ',NULL),(1256,'FF14E7AF-C99F-4CB8-9C0B-5CBC029C4284',NULL,'2024-09-22','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1747573185014_empty.jpg',1,'정말 오랜만의 홈경기!\n전날 두산이 지워준 매직넘버 하나. 그리고 오늘 삼성이 홈에서 직접 지운 마지막 매직넘버.\n1회부터 터진 박병호의 쓰리런 홈런, 구자욱의 연타석 홈런\n그리고 선발투수 원태인의 15승까지... 완벽했던 경기',NULL),(1257,'FF14E7AF-C99F-4CB8-9C0B-5CBC029C4284',NULL,'2024-09-03','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1747573185119_empty.jpg',1,'날씨도 좋고 경기도 이기고~\n행복해요',NULL),(1258,'FF14E7AF-C99F-4CB8-9C0B-5CBC029C4284',NULL,'2024-08-13','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1747573185205_empty.jpg',1,'삼성을 응원하겠다! 마음 먹고 보러 간 첫 직관!!\n1회부터 홈런 빵빵 터지는 재밌었던 경기였다..!!',NULL),(1259,'FF14E7AF-C99F-4CB8-9C0B-5CBC029C4284',NULL,'2024-08-15','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1747573185285_empty.jpg',1,'코너.. 나랑 안맞는걸까?ㅠ',NULL),(1260,'FF14E7AF-C99F-4CB8-9C0B-5CBC029C4284',NULL,'2024-09-07','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1747573185365_empty.jpg',1,'비 오던 라팍...\n시작 할 때 비 와서 중단되나 했는데.. 중단 안하고 그냥 계속 진행했던 경기ㅠ 그렇게 우리는 7회까지 비를 맞으며 경기를 봤습니다...우하하\n백쇼.. 1회부터 홈런 계속 맞고.. 분위기 죽고...ㅠ\n비 맞으면서 볼게 아니고 그냥 집에 갔어야 했어ㅠㅠ',NULL),(1261,'FF14E7AF-C99F-4CB8-9C0B-5CBC029C4284',NULL,'2024-08-23','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1747573185460_empty.jpg',1,'외야 LF4구역이 딱 좌익수 보기 좋은듯!!\n시야도 좋고 응원하기도 나름 굿',NULL),(1262,'FF14E7AF-C99F-4CB8-9C0B-5CBC029C4284',NULL,'2024-08-21','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1747573185568_empty.jpg',1,'어제 잘 하던 삼성 어디갔는데..?\n아침에 취소표 잡아서 왔더니 패배...ㅠ\n그래도 효령이랑 같이 봐서 재밌었음\n(그치만 난 혼야가 더 좋은듯ㅋㅎㅎ',NULL),(1263,'FF14E7AF-C99F-4CB8-9C0B-5CBC029C4284',NULL,'2024-08-25','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1747573185671_empty.jpg',1,'어찌저찌 표를 구해서 들어옴!!\nRF3구역은 좀 별로..\n그치만 선데이 유니폼도 보고\n승리 봤으니 됐다!!',NULL),(1264,'FF14E7AF-C99F-4CB8-9C0B-5CBC029C4284',NULL,'2024-10-15','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1747573185796_empty.jpg',1,'플레이오프 2차전!!\n자세한건 블로그에!!!',NULL),(1265,'FF14E7AF-C99F-4CB8-9C0B-5CBC029C4284',NULL,'2024-09-04','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1747573185910_empty.jpg',1,'경기 시작 1시간 전, 라인업 뜬거 보고 급하게 취소표 잡아서 갔던 경기.\n처음으로 3루 내야지정석도 가보고, 박병호 400호 홈런도 보고 아쥬 즐거웠음!!!',NULL),(1266,'FF14E7AF-C99F-4CB8-9C0B-5CBC029C4284',NULL,'2024-08-20','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1747573186012_empty.jpg',1,'원태인 선발\n그리고 응원석.\n승리.\n크으...',NULL),(1267,'FF14E7AF-C99F-4CB8-9C0B-5CBC029C4284',NULL,'2024-09-25','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1747573186105_empty.jpg',1,'마지막 키움전 승!!\n100만관중 이벤트 너무 즐거웠어요ㅠ\n특히 엘도라도에 맞춰서 불꽃 올려주는거 이거 어떤분이 아이디어 내신거죠? 보너스 왕창 받아가십쇼',NULL),(1268,'C11FC8BE-5065-4787-95DC-50119956C094',248,'2025-05-18','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1747576377933_9FE72869-E191-4EBC-8C92-DD7F5CD6ECD3.jpg',6,'전민재 쓰리뤈~',NULL),(1269,'02225654-588D-4C8C-9200-32E9F1830284',5,'2025-03-22','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/17475793