-4FBC-9944-1AF777292B03.jpg',3,'플레이오프 2차전!! 1차전끝나고 바로 예매했다\n이 날은 패배로 돌아왔지만 배정대 선수의 9회말 홈런은\n레전드였다 졌지만 잘 싸워준 케이티 증말 잘한다\n3차전은 승리로 돌아오자!!!',NULL),(1500,'8E13353B-1979-4BDE-92B1-64816970C0C9',1479,'2024-10-09','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1748744087847_9E9F891E-0DDF-46ED-B3C3-612221E76E54.jpg',3,'티켓팅 실패로 영화관에서 직관했다 영화관으로 보러온 팬분들도\n너무 많아서 좋았고 다같이 응원하는 모습이 너무 낭만있었다\n연장전까지 간 간 경기였지만 승리해서 너무 기뻤고 내일도\n이겼으면 좋겠다 영화관에서 함께 응원한 크트 팬분들 너무\n멋있었어요😻',NULL),(1501,'8E13353B-1979-4BDE-92B1-64816970C0C9',NULL,'2024-11-02','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1748744226761_8C3463BB-DD24-4A47-8C3B-E8329D3DDC6E.jpg',13,'시즌은 종료되었지만 WBC가 남아있었다 첫 고척 직관이였는데\n돔구장이 너무 신기했고 윤동희 선수의 홈런이 너무 기뻤다\n10개 구단의 팬들이 하나가 되어서 응원하니까 더 뿌듯했던거\n같고 우리 마무리 박영현 증말 멋져🍀❤️',NULL),(1502,'8E13353B-1979-4BDE-92B1-64816970C0C9',NULL,'2025-03-08','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1748744395345_BB88544A-336F-44ED-B278-34FB85B854B2.jpg',13,'케이티 첫 시범경기!! 많은 팬분들이 와줘서 너무 좋았다\n선수들 퇴근길도 보고 사인도 받았다 진짜 윤준혁선수 너무\n잘생겼구 앞으로도 1군경기 많이 나와주세요!!\n이제 좀있음 시즌 시작인데 크트 잘 할수 있지??\n오늘도 승요🍀🧚',NULL),(1503,'8E13353B-1979-4BDE-92B1-64816970C0C9',9,'2025-03-23','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1748744535659_5CADB556-0236-42B0-AC2E-590EA2C1207B.jpg',3,'한화와 개막전 연장전까지 갔지만 배정대선수의\n끝내기 안타로 승리했다 22일에는 패배했지만 오늘\n이겨서 너무 행복했다 이제 정규시즌 시작인데 케이티\n이번시즌도 가을야구 가서 꼭 우승하자\n케이티 화이팅🍀🩷',NULL),(1504,'8E13353B-1979-4BDE-92B1-64816970C0C9',89,'2025-04-11','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1748744659541_2902B59B-A8CF-45B3-9BA1-5FD29ACA3994.jpg',3,'또리와 찍은 첫 사진!!!\n오늘은 오랜만에 응원지정석에 앉았당 아니 이번에\n위팍에 요거트월드 생겻는뎅 진짜 너무 마싯써ㅠㅠㅠ\n오늘도 승요로 돌아왔다❤️🍀 오늘 빠따들 너무\n잘해줘서 고마워 앞으로도 이렇게만 해줘',NULL),(1505,'8E13353B-1979-4BDE-92B1-64816970C0C9',184,'2025-05-03','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1748744860969_00A08AC1-7A0B-474D-BC1B-2B89F9422EF5.jpg',3,'가족들과 간 첫 직관