0','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1748885468399_9A930100-2361-4E2B-B122-FA7DD73E4F70.jpg',2,'이승현 ㄷ 엘리 엘리에게 저번에 안좋은 경기를 해서 상당히 무서웠다 하지만 타선이 잘때려주고 불펜이 잘 막아주ㅜㄱ다 박승규때문에 너무 쫄렸다 하지만 이호성이 든든하게 막아줘서 너무 고마웠고 승규는 낼 만회하길~~~~🤭😻',NULL),(1514,'2DD98587-2E3F-4B2B-BDD8-37810E2D3C91',196,'2025-05-06','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1748885590088_A1BAFDEE-0909-4F9E-B2CE-BABBE8C70945.jpg',4,'한화전!! 오늘은 거의 크보 에이스 원태인 류현진 대결이엇다 류현진은 그닥이었는데 오늘 찬스를 너무 많이 놓쳤다…제발 원정이서도 빠따가 살아나멍 좋으겟그🥺😭',NULL),(1515,'2DD98587-2E3F-4B2B-BDD8-37810E2D3C91',301,'2025-05-31','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1748885725603_3611C85A-86E6-4D67-A02E-A264F2D66FB8.jpg',2,'오늘도 이겼다!!!!! 오늘은 박승규가 어제의 실책을 만회하는 4타수 4안타를 때려줬다 요즘에 중요타선이 못하지만 하위가 잘해주몬서 잘 버티는중이다 제발 다 살아나서 낼도 이것으면….낼 티켓없어서 아쉽지만 집관하께…😭😭😭😭',NULL),(1516,'EFCFCECE-7DB7-4E0B-A164-57A58741EAE4',100,'2025-04-13','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1748932363887_258704DA-27E7-472F-8092-F76457B30E71.jpg',7,'2025년 시즌 첫 직관 승리ㅎㅎ',NULL),(1518,'B41A5EAE-325B-4AD7-A96C-1F5BD5CF9801',312,'2025-06-03','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1748954679816_E97E8DFD-5D5E-4DBF-A4EE-1662F227A741.jpg',2,'11:3 승',NULL),(1519,'D0FF6CE9-A9FE-4BEA-BEA9-735564399A83',307,'2025-06-01','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1748957120740_C348B174-49FC-4A37-A847-D4946655A285.jpg',2,'와팡 맜있다.. 한라봉 셔벳보다 빵이 더 맛있었음 의외로 바삭해서 ㅋㅋ \n그래도 한 번은 이길 줄 알았는데 명근이가 투런을 맞을 줄이야\n그래도 영찬이 등판 보고 싶어서 9회 초까지 있었디\n9말 공격이 있었지만 도저히 칠 것 같지 않아서 빠르게 나왔는데 굿 초이스🥰',NULL),(1520,'D0FF6CE9-A9FE-4BEA-BEA9-735564399A83',296,'2025-05-30','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1748957303850_EA33801D-0D04-4732-97BD-FD45ECB3AD1E.jpg',2,'김말국 맛있네예.. 목이 타서 이가네에서 파는 슬러쉬도 먹었는데 불량맛이지만 달달하고 시원했음\n솔직히 선발 매치업상 가장 털 만한 경기였는데 타격이 너무 안 터져서 불안하더라니,, 그래도 9말에 얼라들이 추격의 2점을 보여줘서 생각보다 기분은 세이브됐다\n나름 승요였는데 깨져버린 경기',NULL),(1521,'D0FF6CE9-A9FE-4BEA-BEA9-735564399A83',247,'2025-05-18','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1748957554302_E6DDB111-1176-46C0-B1FD-F4E4144B9993.jpg',2,'키티 티켓+헌신성 아들 시구를 위해 취켓 잡아서 직관한 날\n이가네 순대 맛있었다🥰 간 안 먹는데 안 줘서 좋았음\n초반에 헤이수스를 털었는데 이후로 타격이 잠잠해서,, 이겼지만 뭔가 잔상에 남지는 않는다',NULL),(1522,'D0FF6CE9-A9FE-4BEA-BEA9-735564399A83',222,'2025-05-13','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1748957749152_725FD84E-8063-414F-998A-FF79601EE2C7.jpg',2,'편하게 이길 줄 알았는데 중간에 치리노스가 흔들이면서 굉장히 쫄리는 경기가 되었던.. 결과적으로 이겨서 다행이었지만\n이 날 수학여행 온 학생들이 많았다\n진기가 경기 중에 프롬을 보내줘서 크게 뜬 달을 볼 수 있었당🐰',NULL),(1523,'D0FF6CE9-A9FE-4BEA-BEA9-735564399A83',118,'2025-04-18','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1748957933020_D800DDEE-B21B-4757-9BF0-3781CD0C7FD1.jpg',1,'문학을 처음 가봤다! 크림새우 맛있는데 먹다 보면 물리긴 함\n선발 투수를 못 털면서 접전으로 가다가 막판에 그래도 시원하게 점수 냄\n먼 곳까지 갔는데 이겨서 다행이었다..',NULL),(1524,'D0FF6CE9-A9FE-4BEA-BEA9-735564399A83',1496,'2025-04-12','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1748958148657_75BD7FD7-8671-4A50-9B6F-EDEE19FE38F9.jpg',2,'야구장이 아니라 집 근처에 있는 오토김밥 사감 ㅋㅋ 닭강정 바삭하니 맛있긴 하더라\n기억이 흐릿해서 기록을 찾아보니 선발 매치업 극강이었던 생각보다 다득점은 아니었던... 경기였다\n어쨌든 리드를 놓친 적은 없었고 이겼으면 됐지 뭐☺️',NULL),(1525,'D0FF6CE9-A9FE-4BEA-BEA9-735564399A83',66,'2025-04-06','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1748958316874_82A98F22-65AF-4F9E-A7F8-D91072C887D9.jpg',2,'김말국 처음 먹어봄!\n기아경기 직관만 맨날 져서 슬펐는데 이 날 드디어 처음으로 이겼다..!!\n상대 투수가 스스로 무너져서(잠실 마운드 때문인지) 수월하게 이긴 날🥰',NULL),(1526,'D0FF6CE9-A9FE-4BEA-BEA9-735564399A83',11,'2025-03-25','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1748958519568_E77E1606-B46D-46E2-BA06-781735FB6881.jpg',2,'올해 첫 직관!!\n완전 투수전이었는데 그래도 실점 안 주고 잘 버텨서 후반에 이겨냈구나😇기억이 안 나서 찾아봄 ㅋㅋㅋ\n저 막창 처음 먹어봤는데 가격 대비 창렬하지만 돼지맛이 안 나서 좋았다,, 이후로 또 사 먹음 ㅋ',NULL),(1527,'6BD6CA40-556F-42E4-889C-9AC026AD36CB',1149,'2024-07-12','https://ma