E5D182',NULL,'2024-05-17','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749911092289_empty.jpg',1,'렛두로에 슬기 데려왔는데 어제 무승부 경기 여파로 패요\n딱지도 받았당 ㅎㅎ \n(곰과 호랑이 모두 사람이 되지 않은 경기)\n슬기 감자찌개 먹고 신세계\n근데 원래 지는 경기가 많답니당',NULL),(1635,'37BCE049-82E1-4C22-A90D-8B8C11E5D182',NULL,'2024-05-10','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749911092455_empty.jpg',1,'독수리랑 첫직관🦅\n양의지 유니폼도 사주고 승요도 되고 오늘 완전 생일이네\n한화도 끝내기로 이겨서 둘다 행복한 직관',NULL),(1636,'37BCE049-82E1-4C22-A90D-8B8C11E5D182',NULL,'2024-04-12','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749911092536_empty.jpg',1,'좌 갈매기(상금) 우 엘쥐(재홍)와 함께 잠실 직관\n야구적 재난이 일어나기 전 행복한 곰\n(빈이 퀄스 내놔...1:0으로 지는거 실화냐)',NULL),(1637,'37BCE049-82E1-4C22-A90D-8B8C11E5D182',NULL,'2024-09-16','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749911092618_empty.jpg',1,'수정언니랑 수정언니 친언니랑 같이온 2번째 직관\n더운날 잠실경기는 1루 네이비가 진리다\n이걸 저번 경기로 배웠다\n이겨서....다행이지 정말 연장까지 갔었야 했니....😃\n수빈 데이에 수빈이의 희플로 경기 승리\n비타민도 총총 받아서 고기 엔딩 너무 덥다....',NULL),(1638,'37BCE049-82E1-4C22-A90D-8B8C11E5D182',NULL,'2024-09-14','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749911092707_empty.jpg',1,'취켓으로 겨우 성공한 니느님 은퇴식 직관🥹🥹 (3루 레드)\n이걸 볼 수 있어서 행복했다\n안울줄 알았는데 펑펑운 나란 여자😭😭\n내 젊음이 이렇게 지나가는구나...\n은퇴식 승률 원래 안좋은데 이겨서 얼마나 다행인지\n잘가 니느님 이젠 보내줄게 왕조 시대를 같이 해줘서 고마웠어💕',NULL),(1639,'37BCE049-82E1-4C22-A90D-8B8C11E5D182',NULL,'2024-03-24','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749911092794_empty.jpg',1,'원정 직관 승요🧚 우천중단 되어서 서울 못 올뻔\n(수빈이 초구 홈런에 티빙 원샷🤭)',NULL),(1640,'37BCE049-82E1-4C22-A90D-8B8C11E5D182',NULL,'2024-09-24','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749911092878_empty.jpg',1,'홈막 경기 승리하고 레이저쇼에 너무 행복했다💕💕\n입장줄이 미쳤지만 기다려서 티셔츠도 받고\n행운권은 꽝이었지만 괜찮아\n같이 왔으면 더 즐거웠을 경기🥹\n우리 곰돌이들 진짜 내년에는 더 잘하자🐻\n(이 땐 몰랐지 와카 업셋 당할줄....😢)',NULL),(1641,'37BCE049-82E1-4C22-A90D-8B8C11E5D182',NULL,'2024-09-03','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749911092959_empty.jpg',1,'대전까지 왔는데.....😃이딴 경기력을 돈주고 보러왔다니😃\n이건 그래 화가 나🤬\n진짜 이글스 파크 마지막이라고 온건데 그걸로 만족하자\n열무국수는 못먹었지만... 근데 진짜 열악하긴 하네\n응원단도 없이 팬들이 육성으로 응원하는데 눈물나네😢\n곰돌이들아 제발🐻🤬',NULL),(1642,'37BCE049-82E1-4C22-A90D-8B8C11E5D182',NULL,'2024-09-01','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749911093055_empty.jpg',1,'9월 되었다고 2시 경기 실화냐...!!!!!!😱😱\n네이비여서 그늘일줄 알았는데 그냥 땡볕☀️😡\n갈매기랑 곰이랑 통구이 되었다😃😃\n진짜 이걸 연장까지 가서 지다니.......!!!!!!\n질려면 일찍 지라고 12회 말에 지냐고🤬🤬🤬\n진병신이 된 곰🐻🐻 2시 경기인데 왜 집오니까 10시냐고😱',NULL),(1643,'37BCE049-82E1-4C22-A90D-8B8C11E5D182',NULL,'2024-06-15','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749911093138_empty.jpg',1,'망곰이 너 승요였구나🐻💕💕\n고척 로얄 다이아몬드석도 앉아보고 너무 행복하네\n수정언니랑 수정언니 친언니랑 온 직관⚾️🤭\n크림새우 종류별로 시키고 다코야끼도 시키고 먹산의 위엄을 보여주어야지😁🐻\n카드 헤프닝이 있었지만 즐겁고 행복한 직관 이었당',NULL),(1644,'37BCE049-82E1-4C22-A90D-8B8C11E5D182',NULL,'2024-05-03','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749911093256_empty.jpg',1,'우리 EBS 친구들과 첫 직관 우리가 원정이라 3루에서 익어갔던...\n그래도 승요 시켜주어서 다행🧚\n응원가 나올때 유투브로 연습하고 수행이 입덕한 슬기 \n(그 이후의 우리는 지혜에게 큰 죄를 저질렀지😃)',NULL),(1645,'37BCE049-82E1-4C22-A90D-8B8C11E5D182',NULL,'2024-06-02','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749911093401_empty.jpg',1,'망곰 게시하려고 왔는데..!!그래 난 망곰 게시하려고 온거야😭😭\n엘쥐한테 또 지다니😱😱\n진짜 취켓으로 혼자 열심히 왔는데 패요라니....😞\n하 대체 엘쥐전은 언제 이기냐😡\n(유니폼 제외 망곰 풀세팅🐻)',NULL),(1646,'37BCE049-82E1-4C22-A90D-8B8C11E5D182',NULL,'2024-06-09','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749911093480_empty.jpg',1,'망곰데이는 못참지🐻💕💕\n진짜 이 티켓팅 엄청 힘들었는데 어제 경기를 왔어야 했다🥺🥺\n대체 선발이라서 던진 경기였지만 잘했다\n준호 잘쉬다 올라오렴🥺\n수빈이 빈이 포카도 나오고 경기는 졌지만 나름 만족 했던 직관\n(덥다 더워....☀️)',NULL),(1647,'37BCE049-82E1-4C22-A90D-8B8C11E5D182',NULL,'2024-03-23','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749911093572_empty.jpg',1,'홈개막 in 창원',NULL),(1648,'37BCE049-82E1-4C22-A90D-8B8C11E5D182',NULL,'2024-09-23','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749911093697_empty.jpg',1,'우와!!!! 우리가 쓱을 이겼어💕💕\n나 승요가 되었어🧚\n이렇게 해줬으면 얼마나 좋아🥲\n그래도 기분좋은 승요 기운 받아 내일도 출근\n(ㅇㅅㅇ더비 웅장하다)',NULL),(1649,'37BCE049-82E1-4C22-A90D-8B8C11E5D182',NULL,'2024-09-10','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749911093834_empty.jpg',1,'이딴 경기력을 또!!!!!! 돈 주고 보러 오다니🤬🤬\n아니 누가 키움 꼴찌래???!!\n겁나 잘하잖아😡😡\n곰돌이들아 야구 하기 싫으면 그냥 말해😃\n그리고 내가 택연이 보고 싶다고 했지만 7회는 아니었어....😩\n고맙고 미안하다 아기곰아🥺🐻',NULL),(1650,'37BCE049-82E1-4C22-A90D-8B8C11E5D182',NULL,'2024-06-11','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749911094032_empty.jpg',1,'갈매기 납치 성공🦅🐻 1루 응원석 예매한 나란 양아치 곰😁\n근데.....졌어🥺🥺 이게 맞아... 승요가 독수리였어\n철웅이랑 하이파이브도 하고 분명 분위기 좋았는데...!!\n그래도 피자는 맛있었다 (큰 망곰이를 데리고 왔어야 했다🐻)',NULL),(1651,'37BCE049-82E1-4C22-A90D-8B8C11E5D182',NULL,'2024-04-23','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749911094144_empty.jpg',1,'은지 팔 아픈데도 같이 직관와줘서 고마워\n그렇게 승요가 되어서 즐거운 곰돌이🐻🧚\n(야구 끝나고 먹는 컵라면 너무 맛있지??🤭)',NULL),(1652,'37BCE049-82E1-4C22-A90D-8B8C11E5D182',NULL,'2024-06-20','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749911094258_empty.jpg',1,'슬기랑 미국 가기 전 마지막 직관🐻💕💕\n승요가 되어서 너무 좋았고 홈런도 나왔던 즐거운 경기🧚🧚\n희매 부부도 블루석에서 즐겁게 보고 가서 다행\n(승요가 되어서 어찌나 다행인지...😁)\n나 이제 미국 가면 야구장 가고 싶어서 우째....\n잘 하자 곰들아 가을야구 가자🐻🐻',NULL),(1653,'37BCE049-82E1-4C22-A90D-8B8C11E5D182',NULL,'2024-08-28','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749911094386_empty.jpg',1,'창원에서 승요가 된 곰돌이💕💕🐻\n꺄 드디어 창원을 은지와 왔다\n억지로 끌고 온것 같아서 마음이 무거웠지만 즐거워 해줘서 \n너무 고마워🥺🥺\n역시 자본의 맛 진짜 자리도 라운지도 최고였다🤭\n요아정 시켜먹고 하이라이트 돌려보고 행복한 원정 직관💕',NULL),(1654,'37BCE049-82E1-4C22-A90D-8B8C11E5D182',NULL,'2024-08-29','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749911094479_empty.jpg',1,'즐거웠던 원정직관🐻💕💕비록 오늘은 승요가 아니었다🥹\n승용이 잘 던져줬다 (코너의 공은 어쩔수 없었다..🥹)\n만두라자냐도 먹고 크림새우도 먹었지만 투다리를 못먹었으니 \n내년에 또 오자😁🧚 (약속 땅땅땅)\n나 진짜 얼굴에 즐거움과 행복함이 가득하네\n선수들도 가까이에서 보고 박민우 아버님 건강하세요🤭',NULL),(1655,'6F331E6B-2E35-450F-BBF0-280050B9ABCB',337,'2025-06-08','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749913979800_20EAAC4A-107D-4911-9F99-457F1EC800DA.jpg',2,'하루랑 외야석 가서 철웅이 뱃지 받음! 너무너무 더웠다… 새내이 있는 메가커피 가서 땀좀 식히고 다시 경기장 들어왔는데 한 4회쯤 되니까 그나마 좀 선선하더라ㅠㅠ 암튼 오늘 이유찬 홍건희 복귀 경기였는데 홍건희는 시간이 조금 필요해보였고 유찬이는 너무 잘하고 든든하더라.. 아쉽게 졌지만 나쁘지 않은 하루였다 ㅎㅎ',NULL),(1656,'6F331E6B-2E35-450F-BBF0-280050B9ABCB',367,'2025-06-15','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749914168146_74E1CB78-1605-496A-835C-03F3AC4D5086.jpg',2,'원래는 야구장 갈 생각 없었는데 중네 통로쪽 취소표 뜬거 보고 결제함… 바로 준비하고 출발ㅋㅋㅋ 근데 날씨가 진짜 너무너무 덥더라ㅠㅠ\n오늘은 장바구니 받고 하루 유니폼까지 사줬다 다행히 오늘은 이겨줘서 하루도 기뻐함! 최승용+필승조 모두 나온 경기에다가 양의지 홈런까지 나와서 재밌었던 경기였다 ',NULL),(1657,'31109411-A8D4-4ECE-A582-3919933663FB',349,'2025-06-11','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749981103267_809F7F71-F663-4CBE-B118-529AE1501B33.jpg',7,'졌지만 즐거웠더..',NULL),(1658,'31109411-A8D4-4ECE-A582-3919933663FB',354,'2025-06-12','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749981156782_89F9620B-109E-4D87-A105-29469EC5255D.jpg',7,'위닝💙',NULL),(1659,'DF885F34-0EE0-4A6B-B953-0060A6DB4386',369,'2025-06-15','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749986394402_467098B1-E824-4D18-887D-70177BF595DD.jpg',5,'점수차 실화니?!?!',NULL),(1660,'58FB358C-1BD2-4AB6-BCB7-53FF083A7E23',NULL,'2024-08-03','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749988188440_empty.jpg',1,'이날도 기억이없다',NULL),(1661,'58FB358C-1BD2-4AB6-BCB7-53FF083A7E23',NULL,'2024-09-01','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749988188655_empty.jpg',1,'첫 직관 패배',NULL),(1662,'58FB358C-1BD2-4AB6-BCB7-53FF083A7E23',NULL,'2024-06-02','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1749988188830_empty.jpg',1,'차음으로 벤치클리어링 봄',NULL),(1663,'58FB358C-1BD