onaws.com/uploads/1752156251027_661A1B59-5BA8-4F15-B0EE-16821FF32DAC.jpg',9,'0:4 키움엘지 엘키라시코 직관징크스 깨버린첫날 로젠버그사랑해\n\n',NULL),(1860,'B0BEA8C2-86FB-48A9-9F8A-8B58185D6C30',472,'2025-07-10','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1752156320506_ACBDB284-2FCB-48E2-9603-55218A6910DD.jpg',2,'4:3 엘지 또 이겼다 이걸로 엘키라시코 2:1!!',NULL),(1861,'C11FC8BE-5065-4787-95DC-50119956C094',469,'2025-07-09','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1752157433280_40545236-9431-426C-8306-616067CC3595.jpg',6,'이호준 연장 끝내기 안타!!',NULL),(1862,'869BC27A-4B04-4394-909D-DD0F3E051D04',321,'2025-06-05','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1752158235374_79D30C2F-226E-43D6-A86E-0FBAB404AA02.jpg',4,'첫 직관!\n승현이의 급발진으로 승환현준과 함께 한 직관!\n아쉽게 KT에 7:0 대패했지만 응원가는 확실하게 배웠다!\n다음 직관은 승요로 만들어줘 ^^\n',NULL),(1863,'869BC27A-4B04-4394-909D-DD0F3E051D04',431,'2025-07-01','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1752158531219_B6C28AE0-766B-42EA-B25C-6EF086DB3D08.jpg',4,'두번째 직관은 승현이와 함께!\n조금 늦게 도착한데다 뒤를 바짝 쫓아오던 LG팬 아저씨가 옆자리였는데 심지어 소주까지 밀반입하고 날도 덥고 4회까지 끌려다니던 경기!\n진짜 안 좋은 기억으로 남을 뻔 했지만, 약속의 8회에서 채버지의 적시 쓰리런과 노시환 문현빈의 홈런으로 뒤집어버리면서 기분 정말 좋아졌던 날 !\n\n이런 날만 있었으면 좋겠다 ~',NULL),(1864,'869BC27A-4B04-4394-909D-DD0F3E051D04',436,'2025-07-02','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1752158692144_CF550E8F-9D59-4004-B924-D1B88D7858D3.jpg',4,'오늘은 현준이와 둘이 시리즈 직관 2일차! (전체 3일차)\n\n패배 ‘투수’가 아니라, 패배 ‘타자’라는 말이 있어야겠다ㅋㅋ 문동주 박상원 한승혁 조동욱 모두 잘 했는데 타자들의 병살 그리고 수비상황에서 터져나는 실책 주루사로.. 너무 아쉬웠지만 문동주의 호투를 본 것에 만족!\n\n',NULL),(1865,'869BC27A-4B04-4394-909D-DD0F3E051D04',441,'2025-07-03','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1752158805741_5B070A8A-2DFF-4F88-BEBB-3FEC20BFD3F3.jpg',4,'네번째 직관은 기학 찬형 대현과 함께!\n\n대현이가 주도해서 갔는데, 경기 초반부터 엄상백이 볼질해서 많이 화가 났지만, 사진처럼 엎치락뒤치락 하는 경기라 재미는 정말 넘쳤던 경기! 하지만 마지막에 서현이가 블론상황 만들긴 했지만 다행히 무승부로 마무리 되었던 경기!\n\n서현아 기죽지마라..!!!',NULL),(1866