따ㅜㅜ삼성 이악물었네 \n103구역 10열이였는데 시야도 좋고 통로석이라 대만족\n이렇게 야구장 이곳저곳 좌석 마스터할테댱!!!\n여름 지나 다음은 가을야구 가즈아🤍\n보강집 웨이팅중인데 얼마나 맛있을지 기대즁',NULL),(2071,'CC329318-039E-4A7A-9016-FA337B782748',571,'2025-08-08','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1756651288824_F052668A-5B70-420C-B796-85D6B5D0E95A.jpg',2,'올해 첫 끝내기 승리를 직관했다!! \n끝내기 승리가 아예 없진 않았는데 안타도 홈런도 밀어내기도 뭣도 아닌 끝내기였어서 끝내기 기분이 들지 않아 내기준 올해 끝내기는 아직 없는 상태였다 \n근데 하루종일 꽉 막힌 경기력을 보여줘 썸머홀릭임에도 물도 많이 못 맞고 추위에 벌벌 떨며 봐서 개큰 분노가 있었는데 끝내기 하나로 싹 사라졌다!! ',NULL),(2072,'CC329318-039E-4A7A-9016-FA337B782748',582,'2025-08-10','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1756651450777_019438BB-0E59-4838-AB83-75749D5917C8.jpg',2,'쉽게 오지 않는 썸머홀릭 기간이기에•••• \n코시를 버금가는 1•2위전에 회피하지 않고 이틀이나 참석했다. \n나는 원래 미친듯한 회피형이라 중요한 경기는 내가 굳이 참석하지 않음 + 패요의 기운이 있는듯하여 안감 \n그러나 썸머홀릭 승률 전승인 트윈스와 패요 기운을 가진 내가 합쳐지면? 이번만큼은 내가 좀 져도 되지 않을까하는 마음으로 이틀 감 ',NULL),(2073,'CC329318-039E-4A7A-9016-FA337B782748',602,'2025-08-15','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1756651610114_0AD0DE63-A134-4C1C-942B-0C176F0EC3D0.jpg',1,'엘지 승요 ssg팬과 함께하는 시즌 3번째 직관!!\n오늘은 진짜 개크게 지는 줄 알았음 진심임 \n치리 이 미친놈이 틈만나면 흔들리고 인자한 미소를 지어보이지만 이 사건을 아는 엘디 팬들에겐 그 미소가 사악하기 그지없움 그리고 빠따도 장단을 치리에게 맞춰줌 미친놈들 \n마지막으로….. 조병헌 vs 참치 -> ㅋㅋ 졌다 했는데~~~~ 여기서 참치가 살아나~~~',NULL),(2074,'3BE80E75-A97D-4828-A9B5-BF9BDB58EFED',188,'2025-05-04','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1757115447172_A69B987C-AB5D-4FFF-AAAD-BF0CF71EC41D.jpg',5,'첫 직관!\n두근두근😊',NULL),(2075,'3BE80E75-A97D-4828-A9B5-BF9BDB58EFED',279,'2025-05-25','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1757115559862_4E9BD915-D0C2-49F3-806A-760A39207CC2.jpg',5,'두번째 직관!\nwith 선영, 시언, 채언🤭',NULL),(2076,'3BE80E75-A97D-4828-A9B5-BF9BDB58EFED',338,'2025-06-08','https://match-diary-photo-bucket.s3.ap-northeast-2.amazonaws.com/uploads/1757115670961_3086E017-FE01-4EC4-B84C-2EBC1C7C4797.jpg',5,'세번째 직관! \n후라도 완봉승👍🏻',NULL),(2077,'3BE80E